import "./paginacao.css";
import { connect } from 'react-redux';
import {bindActionCreators} from 'redux';
import { fetchCharactersStart,filterCharactersStart } from '../../actions/index';


/**
 * Componente que contém os botões para paginar
 *
 * Você deve adicionar as propriedades necessárias para que funcione corretamente
 *
 *
 * @returns Elemento JSX
 */
const Paginacao = () => {
  return (
    <div className="paginacao">
      <button disabled={true} className={"primary"}>
        Anterior
      </button>
      <button disabled={false} className={"primary"}>
        Próximo
      </button>
    </div>
  );
};

const mapStateToProps = (state) => ({
  characters:state.characters,
})


const mapDispatchToProps = (dispatch) => bindActionCreators({
  fetchCharactersStart,filterCharactersStart,
},dispatch);
export default connect()(Paginacao);
